import React from 'react'
import Container from 'react-bootstrap/Container';
import styled from 'styled-components'
import logo from '../assets/images/logo.png'
import Box from '@mui/material/Box';

const Footer = () => {
  const Footerwrapper=styled.section`
  background-color:${({theme})=>theme.colors.text7};
  display:flex;
  .widget{
    display:flex;
    flex-wrap:wrap;
    flex-direction:row;
    padding-bottom:50px;
    padding-bottom: 50px;
    border-bottom: 1px solid #8b8b8b;
    .footer_logo{
      img{
        width:90%;
      }
    }
    section{
      flex:1 1 25%;
      color:white;
      padding:16px;
      h1{
        font-size:1rem;
        text-transform: uppercase;
        font-weight: 500;
      }
      span{
        font-weight:200;
      }
    }
  }
  .copyright{
    border: solid red;
    padding: 10px;
    width: 50%;
    margin: auto;
  }

  
  `;

  return (
    <Footerwrapper>
      <Container className='common_footer_margin'>
        <div className='widget'>
          <section className='footer_logo'>
            <img src={logo} alt="demo"/>
          </section>
          <section>
            <h1>weebly themes</h1>
            <span>pre-sale faqs</span>
            <span>submit a ticket</span>
          </section>
          <section>
            <h1>services</h1>
            <span>theme tweak</span>
          </section>
          <section>
            <h1>showcase</h1>
            <span>widgetkit</span>
            <span>support</span>
          </section>
        </div>
        <div className='copyright'>
        <Box sx={{ position: 'relative', mt: 3, height: 320 }}>
        <StyledSpeedDial
          ariaLabel="SpeedDial playground example"
          hidden={hidden}
          icon={<SpeedDialIcon />}
          direction={direction}
        >
          {actions.map((action) => (
            <SpeedDialAction
              key={action.name}
              icon={action.icon}
              tooltipTitle={action.name}
            />
          ))}
        </StyledSpeedDial>
      </Box>
        </div>
      </Container>        
    </Footerwrapper>
  )

}

export default Footer
